import './App.css';
import React from "react";
import {
  Routes,
  Route,
  Link
} from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';

function App() {
  return (
    <Routes>


        <Route path="/" element={<Navbar/>} />

        <Route path="/" element={<Home />} />

    </Routes>

  );
}

export default App;
